import styles from "./TrustedTechnologiesContainer.module.css";

const TrustedTechnologiesContainer = () => {
  return (
    <div className={styles.logos}>
      <div className={styles.workingWithThe}>
        Working with the most trusted technologies
      </div>
      <div className={styles.items}>
        <img className={styles.icon} alt="" src="/11.svg" />
        <img className={styles.icon1} alt="" src="/21.svg" />
        <img className={styles.icon2} alt="" src="/3.svg" />
        <img className={styles.icon3} alt="" src="/4.svg" />
        <img className={styles.icon4} alt="" src="/5.svg" />
        <img className={styles.icon1} alt="" src="/6.svg" />
      </div>
      <img className={styles.hrIcon} alt="" src="/hr.svg" />
    </div>
  );
};

export default TrustedTechnologiesContainer;
